import logo from './logo.svg';
import './App.css';
import FirstApi from "./FirstApi"
import Navbar from "./Navbar"

function App() {
  return (
    <Router>
      <div className="App">
        <Nav />
        <div className="container">
          <Route path="/" exact component={Home} />
        </div>
      </div>
    </Router>
  );

const Home = () => (
  <div>
      <h1>CR ESGI, c'est quoi ?</h1>
      <hr className="my-4" />
      <div className="col-md-10 mx-auto">
        <p> Ce projet a pour but de récupérer des informations sur le clan clash royale de l'ESGI et sur ses membres pour ensuite calculer la participation de chaque élève et lui attribuer une note.</p>
        <p> Ces informations seront affichés et également stockés sur un google sheet. </p>
        <p> On pourra également récupérer d'anciennes valeurs présentes sur un google sheet pour affiner ce processus de notation. </p>
      </div>

      <hr className="my-4" />
      <p>Les deux API utilisées dans ce projet sont <a href="https://developer.clashroyale.com/#/" target="_blank" >Clash Royale API</a> et <a href="https://developers.google.com/drive" target="_blank" >Google Drive API</a></p>

  </div>
  )
}

export default App;
